import AltRouteIcon from '@mui/icons-material/AltRoute';
import FemaleIcon from '@mui/icons-material/Female';
import MaleIcon from '@mui/icons-material/Male';
import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import patients from '../../services/patients';
import { Entry, Gender, Patient } from '../../types';

const PatientDetails = () => {

  const {id} = useParams() 

  const [patient,setPatient]=useState<Patient>()


 useEffect(()=>{

    patients.get(id)
    .then(patient => setPatient(patient))
    .catch(err =>{

      console.error(err.message);
    })

 },[id])


  return (
    <>
    {patient && 
    <div>
        <h2>{patient.name}{'         '}{patient.gender===Gender.Male
        ?<MaleIcon/>:patient.gender===Gender.Female?<FemaleIcon/>:<AltRouteIcon/>}</h2>
        <h3>ssh: {patient.ssn}</h3>
        <h3>occupation: {patient.occupation}</h3>

        {

        }

     </div>
    }
    </>
  )
}

const getEntry=(entry:Entry):JSX.Element=>{

  const assertNever = (data:unknown):never =>{

     throw Error("This should never be called"+data)
  }

  switch(entry.type){

    case 'HealthCheck':
      return <div>
        {<h4>{entry.healthCheckRating}</h4>}
      </div>
    case 'Hospital':
      return <div>
        {<h4>Date:{entry.discharge.date}</h4>}
        {<h4>Date:{entry.discharge.criteria}</h4>}
        </div>
    default:
      return assertNever(entry.type)

  }

}

export default PatientDetails
